import React from 'react';
import './index.css';
import Navbar from './components/Navbar/Nav';
import Hero from './components/HeroSection/Hero';
import  Section from './components/Section/Section';
import Card from './components/Cards/Card';
import IconPage from './IconPage'

function App() {
  return (
    <div>
      <div className='container-fluid'>
          <Navbar/>
           <Hero/>
         </div>

         <section className='OurWork'>
          <Section 
          heading="About Us"
          subHeading="We make creativity work for your brand!"
          content="Ours is a team of creatives that is brainstorming on great ideas, all. the. time. With our skills put together, you get an ensemble capable of doing anything and everything your brand needs."
          btn="Read more"
          />
         </section>

         <section className='OurServices'>
          <Section
          heading="Our Services"
          content="We Help You To Build High-Quality Digital Solutions And Products As Well As Deliver A Wide Range Of Related Professional Services. We Are Providing World-Class Service To Our Clients."
          />
          <Card/>
         </section>
    </div>
  );
}

export default App
